import React from 'react'

const ProductPage = () => {
    return (
        <div class="row center">
            <div class="card">
                <a herf="/singleproduct">
                    <img src="product1.jpg" alt="product"></img>
                </a>    

            </div>
        </div>
    )
}

export default ProductPage
